import React from "react"
import logo from "./logo.svg"
import MBUX from "./assets/images/MBUX.JPG"
import { Card, Grid, Typography } from "@mui/material"

function App() {
  const styles = {
    card: {
      padding: "16px",
    },
  }
  const MbuxImage = () => {
    return <img src={MBUX} />
  }
  return (
    <Card style={styles.card}>
      <Grid>
        <MbuxImage />
        <Typography variant="h3">Some cool work</Typography>
        <Typography variant="subtitle2">2021</Typography>
        <Typography variant="body2">This work is very cool</Typography>
      </Grid>
    </Card>
  )
}

export default App
